_TYPE','4','uint','yes','no','yes','Default object type for new objects'),('DEFAULT_PORT_IIF_ID','1','uint','no','no','no','Default port inner interface ID'),('DEFAULT_PORT_OIF_IDS','1=24; 3=1078; 4=1077; 5=1079; 6=1080; 8=1082; 9=1084','string','no','no','no','Default port outer interface IDs'),('DEFAULT_RACK_HEIGHT','42','uint','yes','no','yes','Default rack height'),('DEFAULT_SLB_RS_PORT','','uint','yes','no','yes','Default port of SLB real server'),('DEFAULT_SLB_VS_PORT','','uint','yes','no','yes','Default port of SLB virtual service'),('DEFAULT_SNMP_COMMUNITY','public','string','no','no','no','Default SNMP Community string'),('DEFAULT_VDOM_ID','','uint','yes','no','yes','Default VLAN domain ID'),('DEFAULT_VST_ID','','uint','yes','no','yes','Default VLAN switch template ID'),('DETECT_URLS','no','string','yes','no','yes','Detect URLs in text fields'),('ENABLE_BULKPORT_FORM','yes','string','no','no','yes','Enable \"Bulk Port\" form'),('ENABLE_MULTIPORT_FORM','no','string','no','no','no','Enable \"Add/update multiple ports\" form'),('enterprise','MyCompanyName','string','no','no','no','Organization name'),('EXT_IPV4_VIEW','yes','string','no','no','yes','Extended IPv4 view'),('FILTER_DEFAULT_ANDOR','or','string','no','no','no','Default list filter boolean operation (or/and)'),('FILTER_PREDICATE_SIEVE','','string','yes','no','no','Predicate sieve regex(7)'),('FILTER_SUGGEST_ANDOR','yes','string','no','no','no','Suggest and/or selector in list filter'),('FILTER_SUGGEST_EXTRA','no','string','no','no','no','Suggest extra expression in list filter'),('FILTER_SUGGEST_PREDICATES','yes','string','no','no','no','Suggest predicates in list filter'),('FILTER_SUGGEST_TAGS','yes','string','no','no','no','Suggest tags in list filter'),('HNDP_RUNNERS_LISTSRC','','string','yes','no','no','List of devices running HNDP (RackCode)'),('IPV4LB_LISTSRC','{$typeid_4}','string','yes','no','no','List source: IPv4 load balancers'),('IPV4NAT_LISTSRC','{$typeid_4} or {$typeid_7} or {$typeid_8}